import React from 'react';
import C from './Nav.module.css';
import { NavLink } from 'react-router-dom';
const Nav = () => {
    return (
        <nav className={C.nav}>
            <div className={C.sidebar_border}>
                <div className={C.sidebar_info}>
                    <NavLink to="/profile" className={C.item}>Profile</NavLink>
                    <NavLink to="/messages" className={C.item}>Messages</NavLink>
                    <NavLink to="/news" className={C.item}>News</NavLink>
                    <NavLink to="/friends" className={C.item}>Friends</NavLink>
                    <NavLink to="/settings" className={C.item}>Settings</NavLink>
                </div>
            </div>
        </nav>
    )
}


export default Nav;
